var myApp=angular.module("myApp",["angularUtils.directives.dirPagination"]);myApp.controller("listController",["$scope","$http",function(t,o){o.get("./data/tracks.json").then(function(o){t.tracks=o.data}),t.removeSong=function(o){t.tracks.splice(t.tracks.indexOf(o),1)},t.addSong=function(o){t.tracks.splice(t.tracks.indexOf(o),1),t.tracks.push(t.addedTracks)}}]),myApp.controller("collectionController",["$scope",function(t){t.addedTracks=[]}]),myApp.controller("sortController",["$scope",function(){$scope.sortType="Artist",$scope.sortReverse=!1}]);